int main(void)
{
    int n, i, j;
    int a[100][100];
    int b[100][100];
    int c[100][100];

    printf(""Enter the size of the matrix: "");
    scanf(""%d"", &n);

    printf(""Enter the elements of the first matrix: 
"");
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
        {
            scanf(""%d"", &a[i][j]);
        }
    }

    printf(""Enter the elements of the second matrix: 
"");
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
        {
            scanf(""%d"", &b[i][j]);
        }
    }

    printf(""The sum of the two matrices is: 
"");
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
        {
            c[i][j] = a[i][j] + b[i][j];
            printf(""%d "", c[i][j]);
        }
        printf(""
"");
    }

    return 0;
}

