//inisialisasi pin
int hourPin = 2;
int minutePin = 3;
int secondPin = 4;

//inisialisasi variabel
int hour = 0;
int minute = 0;
int second = 0;

void setup() {
  //inisialisasi pin
  pinMode(hourPin, OUTPUT);
  pinMode(minutePin, OUTPUT);
  pinMode(secondPin, OUTPUT);
}

void loop() {
  //increment second
  second++;
  if (second == 60) {
    second = 0;
    minute++;
  }
  if (minute == 60) {
    minute = 0;
    hour++;
  }
  if (hour == 24) {
    hour = 0;
  }

  //output ke pin
  digitalWrite(hourPin, hour);
  digitalWrite(minutePin, minute);
  digitalWrite(secondPin, second);

  //delay 1 detik
  delay(1000);
}

