Untuk membuat website di Virtual Studio Code, Anda harus membuat file HTML, CSS, dan JavaScript. Berikut adalah contoh kode untuk membuat website sederhana:

HTML:

<!DOCTYPE html>
<html>
  <head>
    <title>My Website</title>
  </head>
  <body>
    <h1>Welcome to My Website!</h1>
    <p>This is my first website.</p>
  </body>
</html>

CSS:

body {
  background-color: #f2f2f2;
  font-family: sans-serif;
  font-size: 16px;
}

h1 {
  color: #333333;
  font-size: 24px;
  font-weight: bold;
  text-align: center;
}

p {
  color: #333333;
  font-size: 16px;
  line-height: 1.5;
  text-align: center;
}

JavaScript:

console.log(""Welcome to my website!"");"

1. Buatlah struktur folder dan file HTML

Untuk membuat website profesional, Anda harus membuat struktur folder dan file HTML yang tepat. Berikut adalah contoh struktur folder dan file HTML yang dapat Anda gunakan:

- index.html
- css/
  - style.css
- js/
  - script.js
- images/
  - logo.png
  - background.jpg

2. Buatlah kode HTML

Setelah Anda membuat struktur folder dan file HTML, Anda dapat mulai membuat kode HTML untuk website Anda. Berikut adalah contoh kode HTML yang dapat Anda gunakan:

<!DOCTYPE html>
<html>
  <head>
    <title>My Website</title>
    <link rel=""stylesheet"" href=""css/style.css"">
  </head>
  <body>
    <h1>My Website</h1>
    <p>Welcome to my website!</p>
    <script src=""js/script.js""></script>
  </body>
</html>

3. Buatlah kode CSS

Setelah Anda membuat kode HTML untuk website Anda, Anda dapat mulai membuat kode CSS untuk mengatur tampilan website Anda. Berikut adalah contoh kode CSS yang dapat Anda gunakan:

body {
  font-family: sans-serif;
  background-image: url('images/background.jpg');
  background-size: cover;
  color: #333;
}

h1 {
  font-size: 2em;
  font-weight: bold;
  text-align: center;
  margin: 0;
  padding: 0.5em;
  background-color: #eee;
}

4. Buatlah kode JavaScript

Setelah Anda membuat kode HTML dan CSS untuk website Anda, Anda dapat mulai membuat kode JavaScript untuk menambahkan fitur interaktif ke website Anda. Berikut adalah contoh kode JavaScript yang dapat Anda gunakan:

document.addEventListener('DOMContentLoaded', function() {
  // Your code here
});"
